import React from "react";
import filtersvg from "../../resources/icon-svg/filter.svg";
import {ReactSVG} from "react-svg";
import {Redirect} from "react-router";
import {connect} from "react-redux";
import {setIsAuth} from "../../state/app-reducer";
import LogoDronTaxi from "../../resources/icon-svg/LogoDronTaxi.svg";
import {NavLink} from "react-router-dom";

let Profile = (props) => {


    return (props.isAuth !== 'false') ?  <Redirect to="/signin" /> : (
        <>
            <div style={{height: '100%', paddingTop: 64, boxSizing: 'border-box'}}>
                <div style={{height: '100%', backgroundColor: '#660066'}}>

<div style={{height: 'calc(100% - 50px)', paddingLeft: 30, paddingRight: 30, paddingBottom: 10, paddingTop: 40}}>
    <h3 style={{paddingTop: 10, paddingBottom:20}}>Мой профиль</h3>

    <div style={{height: 'calc(100% - 124px)'}}>
        <div style={{height: 'calc(100% - 24px)', backgroundColor: '#880088'}}>
            <div style={{display: "flex", width: '30%'}}>
                <div style={{flex: 1}}>
                    <h5 style={{margin: 0}}>Личные данные</h5>
                </div>
                <div>
                    <h5 style={{margin: 0}}>Роли</h5>
                </div>
            </div>
        </div>
    </div>
</div>




                </div>
            </div>
        </>
    )
}

const mapStateToProps = (state) => ({
    isAuth: state.appReducer.isAuth
})

export default connect(mapStateToProps, {setIsAuth})(Profile);
